Note: The query provided is not a standard SQL query. It seems to be a query that joins two tables, `usa_state` and `usa_border_info`, on the `state_name` column. The result is a list of capitals of states that share a border with Texas. However, the query is not filtering the results to only include the capitals of states that share a border with Texas, it's including all the capitals of the states in the `usa_state` table. 

If you want to get the capitals of the states that share a border with Texas, you should add a filter to the query, like this:

```sql
SELECT t2.capital 
FROM usa_state AS t2 
JOIN usa_border_info AS t1 ON t2.state_name  =  t1.border 
WHERE t1.state_name  =  'texas';
```

This query will return the capitals of the states that share a border with Texas.

